import './Badge.scss';

export default function Badge(props) {
    return (
        <div id="badge">
            <div id="badge--div">
                <h2>Badge</h2>
                {/*  Photo*/}
                {/* Rank */}
                {/* Total Score */}
                {/* Games */}
                {/* Achievements */}
            </div>
            <div>
                <h2>Wins</h2>
            </div>
        </div>
    )
}

// class Badge
